import Card from '../Card/Card';
import style from './Cards.module.css';

export default function Cards({characters, onClose}) {
   return (
   <div className={style.container}>{characters.map(({id, name, species, gender, origin, image, status}) => {
      return (
      <Card 
         key={id}
         id={id}
         name={name}
         status={status}
         species={species}
         gender={gender}
         origin={origin.name}
         image={image}
         onClose={onClose}
      />
      )
})}
   </div>
   )
}
